// src/components/NavLinks.js
import React from 'react';
import { NavLink } from 'react-router-dom';

const linkStyle = {
  color: '#fff',
  textDecoration: 'none',
  fontWeight: '500',
  transition: 'color 0.3s ease'
};

const NavLinks = () => {
  return (
    <nav style={{
      display: 'flex',
      justifyContent: 'center',
      gap: '2rem'
    }}>
      <NavLink
        to="/"
        end
        style={({ isActive }) => ({
          ...linkStyle,
          color: isActive ? '#ffa500' : '#fff'
        })}
      >
        Intro
      </NavLink>
      <NavLink
        to="/algo/1"
        style={({ isActive }) => ({
          ...linkStyle,
          color: isActive ? '#ffa500' : '#fff'
        })}
      >
        Algorithm 1
      </NavLink>
      <NavLink
        to="/algo/2"
        style={({ isActive }) => ({
          ...linkStyle,
          color: isActive ? '#ffa500' : '#fff'
        })}
      >
        Algorithm 2
      </NavLink>
      <NavLink
        to="/algo/3"
        style={({ isActive }) => ({
          ...linkStyle,
          color: isActive ? '#ffa500' : '#fff'
        })}
      >
        Algorithm 3
      </NavLink>
    </nav>
  );
};

export default NavLinks;
